var areaCont, areaList = $("#areaList");

//选中的省市区各级id
var pidx, cidx, aidx, zipCodex;


//初始化省份
function intProvince() {
    areaCont = "";
    for (var i = 0; i < areaData.length; i++) {
        var list = areaData[i];
        if (list.parentId == 0) {
            areaCont += '<li onClick="selectP(' + list.id + ');">' + list.areaName + '</li>';
        }
    }
    areaList.html(areaCont);
    $("#areaBox").scrollTop(0);
    $("#backUp").removeAttr("onClick").hide();
}

//选择省份
function selectP(p) {
    areaCont = "";
    areaList.html("");
    for (var j = 0; j < areaData.length; j++) {
        if (p == areaData[j].id) {
            var citys = areaData[j].juniorList;
            for (var k = 0; k < citys.length; k++) {
                var list = citys[k];
                areaCont += '<li onClick="selectC(' + p + ',' + list.id + ');">' + list.areaName + '</li>';
            }
            break;
        }
    }
    areaList.html(areaCont);
    $("#areaBox").scrollTop(0);
    $("#backUp").attr("onClick", "intProvince();").show();
}

//选择城市
function selectC(p, c) {
    areaCont = "";
    for (var k = 0; k < areaData.length; k++) {
        if (p == areaData[k].id) {
            var citys = areaData[k].juniorList;
            for (var i = 0; i < citys.length; i++) {
                if (c == citys[i].id) {
                    var areas = citys[i].juniorList;
                    for (var j = 0; j < areas.length; j++) {
                        var list = areas[j];

                        areaCont += '<li onClick="selectD(' + p + ',' + c + ',' + list.id + ',' + list.zipCode + ');">' + list.areaName + '</li>';
                    }
                    break;
                }
            }
        }
    }
    areaList.html(areaCont);
    $("#areaBox").scrollTop(0);
}

//选择区县处理
function selectD(p, c, d, zipCodes) {
    pidx = p;
    cidx = c;
    aidx = d;
    zipCodex = zipCodes;
    clockArea();
    $("#expressArea").val(getAreaAll(p, c, d));
    console.log(p + "-" + c + "-" + d)
}

//关闭省市区选项
function clockArea() {
    $("#areaMask").fadeOut();
    $("#areaLayer").animate({"bottom": "-100%"});
}


//获取省市区name
function getAreaAll(sid, cid, aid) {
    var name = '';
    for (var i = 0; i < areaData.length; i++) {
        if (areaData[i].id == sid) {
            name += areaData[i].areaName;
            var cityList = areaData[i].juniorList;
            for (var j = 0; j < cityList.length; j++) {
                if (cityList[j].id == cid) {
                    name += cityList[j].areaName;
                    var area = cityList[j].juniorList;
                    for (var k = 0; k < area.length; k++) {
                        if (area[k].id == aid) {
                            name += area[k].areaName;
                        }
                    }
                    break;
                }
            }
        }
    }
    return name;
}

//获取省市区name code
function getAreaAllCode(scode, ccode, acode) {
    var name = '';
    for (var i = 0; i < areaData.length; i++) {
        if (areaData[i].areaCode == scode) {
            name += areaData[i].areaName;
            var cityList = areaData[i].juniorList;
            for (var j = 0; j < cityList.length; j++) {
                if (cityList[j].areaCode == ccode) {
                    name += cityList[j].areaName;
                    var area = cityList[j].juniorList;
                    for (var k = 0; k < area.length; k++) {
                        if (area[k].areaCode == acode) {
                            name += area[k].areaName;
                        }
                        break;
                    }
                }
                break;
            }
            break;
        }
    }
    return name;
}